import React, { useState } from 'react';
import { Route, Routes, Link, useNavigate } from 'react-router-dom';
import HomePage from './HomePage';
import CategoryPage from './CategoryPage';
import PhotoDetail from './PhotoDetail';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { Button, AppBar, Toolbar, Typography, Box, TextField, CssBaseline, IconButton, Drawer, List, ListItem, ListItemButton, ListItemText, Divider } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';

const theme = createTheme({
  palette: {
    primary: { main: '#6366f1' },
    secondary: { main: '#06b6d4' },
    background: { default: '#f4f4f9' },
  },
  typography: {
    fontFamily: '"Inter", "Roboto", sans-serif',
    h5: { fontWeight: 700 },
    body1: { fontSize: '1rem' },
  },
  components: {
    MuiCard: {
      styleOverrides: {
        root: {
          borderRadius: 12,
          overflow: 'hidden',
          transition: 'transform 0.3s, box-shadow 0.3s',
          '&:hover': {
            transform: 'scale(1.03)',
            boxShadow: '0 12px 35px rgba(0,0,0,0.2)',
          },
        },
      },
    },
  },
});

function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [mobileOpen, setMobileOpen] = useState(false);
  const navigate = useNavigate();

  const handleDrawerToggle = () => setMobileOpen(!mobileOpen);
  const handleDrawerClose = () => setMobileOpen(false);
  const handleSearch = (event) => {
    event.preventDefault();
    if (searchTerm.trim()) {
      navigate(`/category/${searchTerm.trim()}`);
      setSearchTerm('');
      handleDrawerClose();
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="sticky" elevation={4} sx={{ background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)' }}>
        <Toolbar>
          <Typography variant="h5" component={Link} to="/" sx={{ color: 'white', textDecoration: 'none', flexGrow: 1 }}>
            Fotoğraf Galerisi
          </Typography>

          <Box sx={{ display: { xs: 'none', md: 'flex' }, gap: 1, alignItems: 'center' }}>
            {['Doğa', 'Teknoloji', 'Seyahat'].map(cat => (
              <Button key={cat} color="inherit" component={Link} to={`/category/${cat.toLowerCase()}`} sx={{ textTransform: 'none' }}>{cat}</Button>
            ))}

            <Box component="form" onSubmit={handleSearch} sx={{ display: 'flex', alignItems: 'center', ml: 2 }}>
              <TextField
                placeholder="Ara..."
                variant="outlined"
                size="small"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                sx={{
                  '& .MuiOutlinedInput-root': {
                    borderRadius: 2,
                    backgroundColor: 'rgba(255,255,255,0.15)',
                    '& fieldset': { borderColor: 'transparent' },
                    '&:hover fieldset': { borderColor: 'white' },
                    '&.Mui-focused fieldset': { borderColor: 'white' },
                  },
                  '& .MuiInputBase-input': { color: 'white' },
                }}
              />
              <Button type="submit" sx={{ ml: 1, color: 'white', borderRadius: 2, textTransform: 'none' }}>Ara</Button>
            </Box>
          </Box>

          <IconButton
            color="inherit"
            edge="end"
            onClick={handleDrawerToggle}
            sx={{ display: { md: 'none' } }}
          >
            <MenuIcon />
          </IconButton>
        </Toolbar>
      </AppBar>

      <Drawer
        variant="temporary"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        ModalProps={{ keepMounted: true }}
        sx={{ '& .MuiDrawer-paper': { width: 280 } }}
      >
        <Box sx={{ p: 2 }}>
          <List>
            {['Doğa', 'Teknoloji', 'Seyahat'].map(cat => (
              <ListItem key={cat} disablePadding>
                <ListItemButton component={Link} to={`/category/${cat.toLowerCase()}`} onClick={handleDrawerClose}>
                  <ListItemText primary={cat} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider sx={{ my: 2 }} />
          <Box component="form" onSubmit={handleSearch} sx={{ display: 'flex', gap: 1 }}>
            <TextField
              placeholder="Ara..."
              size="small"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              fullWidth
            />
            <Button type="submit" variant="contained">Ara</Button>
          </Box>
        </Box>
      </Drawer>

      <Box sx={{ p: { xs: 2, md: 4 }, minHeight: 'calc(100vh - 64px)' }}>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/category/:category" element={<CategoryPage />} />
          <Route path="/photo/:id" element={<PhotoDetail />} />
        </Routes>
      </Box>
    </ThemeProvider>
  );
}

export default App;
